هل وجدتني يوما اقول ان سلمان كان يسبح مع بريجيت باردو مثلا!؟؟ او انك كنت ترتاد كوكب المريخ مع ثلة من مدمني المخدرات؟؟
تكرار قصص كاذبة وبدون دليل هي الموهبة الوحيدة التي يتمتع بها نظام منشار وذبابه

@HuseinNourdin ولاحظ اني قلت "تنشىء".
اون سان سوتشي لم تنشىء الجيش المجرم ، كان موجودا وفي ملف الروهينغيا دافعت عنه.
كم شبيحة دافعت وتدافع عن جرائم جيش الاسد؟ كثيرات.لكن القائد رجل.

@wafaalamm الجانب الامريكي على لسان المتحدثة باسم مجلس الامن القومي نفى ان يكون بايدن تحدث او ينوي التحدث مع ابن سلمان.
بل تكلم مع والده.
واكدت انه لم تحدث اي مشاكل في الاتصال بين بايدن وابن زايد.

